def cleanup(curve):
    pairs = list(curve.items())
    filtered_curve = {}

    # remove duplicate values and values which don't fit between neighbors
    for i in range(1, len(pairs) - 1):
        if pairs[i - 1][0] == pairs[i][0]:
            continue
        if pairs[i][1] < pairs[i - 1][1] and pairs[i][1] < pairs[i + 1][1] and (
                pairs[i][0] - pairs[i - 1][0] < 2 or pairs[i + 1][0] - pairs[i][0] < 2):
            continue
        if pairs[i][1] > pairs[i - 1][1] and pairs[i][1] > pairs[i + 1][1] and (
                pairs[i][0] - pairs[i - 1][0] < 2 or pairs[i + 1][0] - pairs[i][0] < 2):
            continue
        filtered_curve[pairs[i][0]] = pairs[i][1]

    # convert to spectral distribution and align with shape
    spectral_distribution = colour.SpectralDistribution(filtered_curve)
    spectral_distribution.align(spectral_shape, extrapolator_kwargs={'method': 'linear'}).align(spectral_shape)

    density_values = xp.asarray(spectral_distribution.values)

    return density_values


